funcOther:
  function funcOther() {
    log("funcOther");
    const tag = localStorage.getItem("TZ_MAIN");
    if (tag && new Date().getTime() - tag < 1000 * 5) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_MAIN", new Date().getTime());

    location.href = "https://www.seowongolf.co.kr/m_hills/index.do";
  }

funcReserve:
  function funcReserve() {
    log("funcReserve");
    const tag = localStorage.getItem("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 10) {
      funcEnd();
      return;
    }
    localStorage.setItem("TZ_LOGOUT", new Date().getTime());

    TZLOG(logParam, (data) => {});
    timer(1000, () => {
      onClickDay(fulldate);
      setTimeout(funcTime, 2000);
    });
  }

funcTime:
  function funcTime() {
    log("funcTime");
    const els = window["time-grid"].getElementsByTagName("tr");
    let target;
    Array.from(els).every((el) => {
      const strParam = el.children[0].str();
      const elTime = strParam.regex(/[^0-9]/g);
      const elCourse = strParam.regex(/[^가-힣]/g).ch(2);
      log(time == elTime, dictCourse[course] == elCourse);
      log(time, elTime, dictCourse[course], elCourse);
      if (time == elTime && dictCourse[course] == elCourse)
        target = el.children[4].children[0];

      return !target;
    });
    log("target", target);
    if (target) {
      target.click();
      timer(1000, funcExec);
    } else {
      LOGOUT();
    }
  }

funcExec:
  function funcExec() {
    log("funcExec");
    const tag = localStorage.getItem("TZ_EXEC");
    if (tag && new Date().getTime() - tag < 1000 * 5) return;
    localStorage.setItem("TZ_EXEC", new Date().getTime());

    log("click");
    document.gcn("btnBox4")[0].gcn("motion")[0].click();
  }

funcEnd:
function funcEnd() {
  log("funcEnd");
  const strEnd = "end of reserve/reserve";
  logParam.message = strEnd;
  TZLOG(logParam, (data) => {});
  const ac = window.AndroidController;
  if (ac) ac.message(strEnd);
}
